"Magnit delivery" is an application for home delivery of groceries from Magnit. For residents of Moscow and Krasnodar. Magnit is now at your home!

In the application:
• no more heavy packages – we will bring purchases directly to the door and hand them over without contact;
• we will select goods as for ourselves. And if something is out of stock – we will offer a worthy replacement!

In the new application "Magnit Delivery" you can:
• order groceries from 5,000 names with home delivery in Moscow and 25,000 names with home delivery in Krasnodar
• pay for the order by card in the application;
• register and store order history;
• receive push notifications with order status;
Also you can set up notifications, read privacy policies and contact support in personal account.

Delivery terms in Moscow:
• within 60 minutes within the MKAD;
• daily from 8:00 to 22:00;
• delivery cost from 49 rubles and free for orders over 999 rubles;
• weight limit – 30 kg.

Delivery terms in Krasnodar:
• after 3 hours at the same day, or at 60 min time interval 
• daily from 10:00 to 22:00;
• minimum order amount is 500 rubles;
• delivery cost 199 rubles and free for orders over 3000 rubles; 
• weight limit – 50kg.

Сервис доставки «Антей» представляет удобное приложение по доставке еды, продуктов, товаров, цветов по Краснодару и пригороду. 

Приложении «Антей» –  это:
- Более 150 кафе и ресторанов Краснодара, в числе которых «Дар Пицца», «Т-Кафе», «Nonna Mia», «Сушитория», «Диканька», «Станъ», «Prima Vera», «Хлебные истории», «Матрешка» и другие.
- Магазины, супермаркеты, кулинарии, цветочные салоны, аптеки;
- Фотографии блюд и актуальное меню;
- Акции, бонусы, скидки, промокоды от партнеров;
- Новости кафе, ресторанов, супермаркетов Краснодара.

С помощью приложения «Антей» в несколько кликов вы сможете:
- Выбрать любимое кафе, ресторан или пиццерию и заказать понравившиеся блюда;
- Оформить заказ с бесплатной доставкой;
- Оформить заказ в ночное время;
- Заказать доставку продуктов с рынка или супермаркета, товаров из аптек;
- Заказать букет цветов для любимого человека;
- Оформить заказ в свободной форме, написав все то, что вам нужно привезти;
- Накапливать и тратить бонусные баллы на вкусные блюда;
- Устраивать спонтанные семейные посиделки или накрывать праздничные столы для друзей, тратя на это не более часа;
- Экономить собственное время на готовке еды и походах по магазинам.

Преимущества приложения «Антей»:
- Приветственные 700 баллов за установку;
- Расценки заведений и магазинов без наценок;
- Начисление бонусов за заказы, в день рождения, за отзыв и др;
- Выгодные акции от партнеров, промокоды;
- Возможность отслеживать статус заказа;
- Круглосуточная поддержка call-центра, где вам ответят на любой вопрос;
- Доставка еды в термосумках в течение 45 минут собственной курьерской службой.

